sys_variable_value.value:
(function execute(inputs, outputs) {
  var toolHandler = new CodefreshIntegrationHandler();
  var connectionInfo = toolHandler.getConnectionInfo(inputs.toolGr.getUniqueValue());
  var respath = "/api/user";
  gs.info("Codefresh Connect action - respath :" + respath);
  outputs.resourcepath = respath;
})(inputs, outputs);

