sys_variable_value.value:
(function execute(inputs, outputs) {
	gs.info("Codefresh Connect action - statusCode:" + inputs.statusCode);
    gs.info("Codefresh Connect action - errorMessage:" + inputs.errorMessage);

    outputs.connected = inputs.statusCode == '200';
    outputs.errorMessage = !gs.nil(inputs.errorMessage) ? inputs.errorMessage : '';
})(inputs, outputs);

